import React from 'react';
import './App.css';
import {connect} from "react-redux";

function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      { props.counter }
    </div>
  );
}

const mapStateToProps = (state) => ({
  counter: state.counterReducer
});

export default connect(mapStateToProps)(App);
